__NUXT_JSONP__("/drugs/Retaspimycin", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"857402-23-4",chebiId:"",chemicalFormula:"C31H45N3O8",definition:"A small-molecule inhibitor of heat shock protein 90 (HSP90) with antiproliferative and antineoplastic activities. Retaspimycin binds to and inhibits the cytosolic chaperone functions of HSP90, which maintains the stability and functional shape of many oncogenic signaling proteins and may be overexpressed or overactive in tumor cells. Retaspimycin-mediated inhibition of HSP90 promotes the proteasomal degradation of oncogenic signaling proteins in susceptible tumor cell populations, which may result in the induction of apoptosis.",fdaUniiCode:"BZF2ZM0I5Z",identifier:"C80378",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C2516"],synonyms:["17-Allylamino-17-demethoxygeldanamycin Hydroquinone","Geldanamycin, 18,21-didehydro-17-demethoxy-18,21-dideoxo-18,21-dihydroxy-17-(2-propenylamino)-","RETASPIMYCIN",a]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FRetaspimycin",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Retaspimycin","2021-10-30T13:45:41.073Z")));